Reviewable doesn't show line numbers in the diff for a number of reasons — there's a long discussion in issue #147 . The snippet below overrides this. It's not perfect but it should work in the vast majority of cases: div[data-line-number]:not([data-line-number="0"]):before { content:attr(data-line-number); position:absolute; color: #444; padding: 1px 3px 3px; font-size: x-small; display: block; width: 20px; text-align: right;
}
div[data-line-number]:not([data-line-number="0"]) div.hljs { margin-left: 26px;
} If you don't need to tweak these styles, just paste https://gist.githack.com/pkaminski/4fd7c7b9014856de32bb43f84a396772/raw/line_numbers.css into the custom stylesheet field. Be careful though: by changing the layout in this way, Reviewable won't be able to automatically pick a diff width that fits your window so you'll need to control it manually .

111.body:
When in side-by-side diff mode, Reviewable doesn't highlight the whole line — just the deltas. If you'd prefer the full line to also be highlighted like in unified diff mode you can use these styles: .two.column.diff .diff.line:not(.keep) .line.wrapper:not(.empty) .left.line.content { background-color: #FBDDDD; /* rgba(91, 220, 114, 0.20) on white */
}
.two.column.diff .diff.line.base:not(.keep) .line.wrapper:not(.empty) .left.line.content,
.two.column.diff .diff.line.whitespace:not(.keep) .line.wrapper:not(.empty) .left.line.content { background-color: #FFF7F7; /* rgba(91, 220, 114, 0.05) on white */
} .two.column.diff .diff.line:not(.keep) .line.wrapper:not(.empty) .right.line.content { background-color: #DDF7E2; /* rgba(91, 220, 114, 0.20) on white */
}
.two.column.diff .diff.line.base:not(.keep) .line.wrapper:not(.empty) .right.line.content,
.two.column.diff .diff.line.whitespace:not(.keep) .line.wrapper:not(.empty) .right.line.content { background-color: #EFFCF1; /* rgba(91, 220, 114, 0.05) on white */
} .two.column.diff .diff.line .left.line.content .delta { background-color: rgba(240, 92, 92, 0.30);
}
.two.column.diff .diff.line.base .left.line.content .delta,
.two.column.diff .diff.line.whitespace .left.line.content .delta { background-color: rgba(240, 92, 92, 0.15);
} .two.column.diff .diff.line .right.line.content .delta { background-color: rgba(91, 220, 114, 0.30);
}
.two.column.diff .diff.line.base .right.line.content .delta,
.two.column.diff .diff.line.whitespace .right.line.content .delta { background-color: rgba(91, 220, 114, 0.15);
} Or just use this link: https://rawgit.com/pkaminski/2922da3d58f76a8ed7bf/raw/highlight_lines_in_two_columns.css.

114.body:
Want to turn the wavy lines off to simplify how collapsed diff regions look? This snippet will do the trick: .review-page .file.root .file .wavy.edge { background-image: none;
} .review-page .file.root .file .top.wavy.edge { margin-top: 1em; margin-bottom: -0.5em;
} .review-page .file.root .file .bottom.wavy.edge { margin-bottom: 0.5em;
} .review-page .file.root .file .declaration.include { padding-top: 1em;
} You can also use this link: https://rawcdn.githack.com/earlAchromatic/reviewable-custom-styles/6e35f21b6fa3d3978a4ae5f8ba0f23e2d5d6a475/no-wave.css

70.body:
You can point to a custom stylesheet that you want to apply to all diffs. Reviewable uses highlight.js , so you might prefer to use one of those predefined styles that can be found in their styles directory . To use the GitHub style, for example, set the URL to https://cdnjs.cloudflare.com/ajax/libs/highlight.js/8.2/styles/github.min.css. You can also create your own styles . Ensure that the stylesheet is served as text/css. It may be necessary for you to use https://raw.githack.com or another similar service. We also have a few extra styles used to highlight tabs, trailing whitespace, and lack of final newline that you can customize: .tab, .no-newline, .trailing { color: #D95C5C;
} .tab:before { content: "\00bb\00a0\00a0\00a0";
} .no-newline:before { content: "\00a0\20e0\23ce";
} By default, only the actual deltas have red/green highlights in two-column mode. If you'd like the whole line to be highlighted as well (like on GitHub) you can add the styles from this example . See more snippets at visual tweaks .
